import React from 'react';
import './App.css';
import { makeStyles, CssBaseline, createTheme, ThemeProvider } from '@material-ui/core';
import {Switch, Route, BrowserRouter} from "react-router-dom";
import Admins from '../pages/Associations/eglises/Eglise';
import Membres from '../pages/Associations/paiements/Paiement';
import Zone from '../pages/Associations/zones/Zone';
import dashboard from '../pages/Associations/dashboard/dashboard';
import Login from '../pages/Associations/Authticate/Login';
import Eglise from '../pages/Associations/eglises/Eglise';
import Paiement from '../pages/Associations/paiements/Paiement';
import Region from '../pages/Associations/regions/Region';

const theme = createTheme({
  palette: {
    primary: {
      main: "#70269f",
      light: '#e6faff'
    },
    secondary: {
      main: "#f83245",
      light: '#f8324526'
    },
    background: {
      default: "#f4f5fd"
    },
  },
  overrides:{
    MuiAppBar:{
      root:{
        transform:'translateZ(0)'
      }
    }
  },
  props:{
    MuiIconButton:{
      disableRipple:true
    }
  }
})


const useStyles = makeStyles({
  appMain: {
    paddingLeft: '250px',
    width: '100%'
  }
})

function App() {
  const classes = useStyles();

  return (
    <>
      <BrowserRouter>
        <ThemeProvider theme={theme}>
          <div className={classes.appMain}>
            <Switch>
            <Route path="/" exact component={ Login } />
              <Route path="/dashboard" exact component={ dashboard } />
              <Route path="/eglises" exact component={ Eglise } />
              <Route path="/zones" exact component={ Zone } />
              <Route path="/regions" exact component={ Region } />
              <Route path="/paiements" exact component={ Paiement } />
            </Switch>
          </div>
          <CssBaseline />
        </ThemeProvider>
      </BrowserRouter>
    </>
  );
}

export default App;
